import{_ as e,o as i,c as d,a as s}from"./app-ff2f634e.js";const t="/assets/f84d298c0bfa42c5bd47ed416070cd1b_307b58ab8fe649b89-eee2074a.webp",n="/assets/71d2473922b64385a64fb210047bb1b5_d0e044cb02fe4ebeb-d48ed3e6.webp",A="/assets/278740e7b03145eb8d5aa91a1a875eb1_705074cf150d49278-21e29fb8.webp",a="data:image/webp;base64,",r="/assets/6e4981a53973439991dfb727aea78c3f_481fcc933b3945b19-730ec0ab.webp",g="/assets/206cacbd12454fd8b07deb90559a99cb_0915b7ea1d8746188-42c43722.webp",l="/assets/5632c192fd0a4dc5a4b0014f1259f293_70096d21ea2f4650a-4d31e927.webp",o="/assets/627b5b1f99cd45b59c8a69f04c011668_a716e3ee29ec4988a-8144b734.webp",c="/assets/44d773ee20ef43fe970182fbbbf06e7d_33918be65b2142f69-f75e6bec.webp",v="data:image/webp;base64,",p="/assets/4676e97aeb4249d5b4d4115072ac16b9_4da22181e082400a8-ead8686f.webp",b="/assets/b9633614e16c4509843210225557b456_9e8a130f6b9045b7b-5f74d05c.webp",u="data:image/webp;base64,",E="data:image/webp;base64,",m="/assets/6edaa8e238104a80ae9fffdc0f644bbd_b782e9f4d7224daf8-7d93d57b.webp",C={},h=s('<h2 id="一、圣杯布局与双飞翼布局" tabindex="-1"><a class="header-anchor" href="#一、圣杯布局与双飞翼布局" aria-hidden="true">#</a> 一、圣杯布局与双飞翼布局</h2><p>首先我们需要知道两种布局的需求是什么。</p><p><strong>需求都是实现如下的三列布局</strong>，（重点！！）</p><p><strong>1、两侧内容宽度固定，中间内容宽度自适应</strong></p><p><strong>2、三栏布局，中间一栏最先加载、渲染出来</strong></p><p>即便布局类似，二者还是有本质上的区别：</p><img width="756" height="261" src="'+t+`" class="jop-noMdConv"><p>可以看到，圣杯布局和双飞翼布局最不同的点就是<strong>中间栏的区域不同</strong>。空口说也说不出个一二三，直接看实现过程👇</p><h2 id="二、圣杯布局的实现过程" tabindex="-1"><a class="header-anchor" href="#二、圣杯布局的实现过程" aria-hidden="true">#</a> 二、圣杯布局的实现过程</h2><p>首先写一下基本的html：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code> &lt;div class=&quot;header&quot;&gt;header&lt;/div&gt;
    &lt;div class=&quot;content wrapper&quot;&gt;
        &lt;div class=&quot;middle&quot;&gt;middle&lt;/div&gt;
        &lt;div class=&quot;left&quot;&gt;left&lt;/div&gt;
        &lt;div class=&quot;right&quot;&gt;right&lt;/div&gt;
    &lt;/div&gt;
    &lt;div class=&quot;footer&quot;&gt;footer&lt;/div&gt;
复制代码
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>这里注意要将middle即中间区域放在左边和右边前面，因为我们的需求是中间一栏最先加载、渲染出来，根据执行顺序所以把middle放在第一个。</p><p>然后写一下基本的CSS，加上背景颜色和宽高方便查看：</p><img width="756" height="408" src="`+n+`" class="jop-noMdConv"><p>基本的布局搭好之后，我们只需要将<strong>中间三个实现成我们需要的三栏布局</strong>就好了。</p><p>首先设置一下左右两栏的宽度，中间栏由于是自适应，所以宽度设置成<strong>100%</strong>。</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>.middle {
        width: 100%;
    }
    .left {
        width: 100px;
    }
    .right {
        width: 100px;
    }
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><img width="756" height="399" src="`+A+'" class="jop-noMdConv"><p>然后就到了重点，我们需要在每一栏加上<strong>浮动向左</strong>，因为我们需要他们显示在同一行，但是这样会带来一个问题就是<strong>高度塌陷</strong>。如图：</p><img width="756" height="257" src="'+a+`" class="jop-noMdConv"><p>此时我们有两种解决方案，</p><p>1、第一个就是在内容区域也就是三栏布局设置<code>overflow:hidden</code>，触发<strong>BFC</strong>撑开区域。</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>.content {
        overflow: hidden;
    }
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>解决如下： <img width="756" height="320" src="`+r+`" class="jop-noMdConv"></p><p>2、第二个方法就是在底部footer区域<strong>清除浮动</strong>，解决高度塌陷：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>.footer {
        clear: both;
    }
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>同样也能解决👇 <img width="756" height="317" src="`+g+`" class="jop-noMdConv"></p><p>解决完高度塌陷的问题，我们就需要想办法<strong>把左边的盒子移动上去</strong>。</p><p>首先设置middle栏的<code>padding</code>,让中间这一栏左右留出区域方便我们放进去。</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>.wrapper {
        padding-left: 100px;
        padding-right: 100px;
    }
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><img width="756" height="316" src="`+l+'" class="jop-noMdConv"><p>此时我们其实只需要通过<strong>相对定位</strong>，<strong>他们现在可以看成是一行放不下挤成了2行，所以左边这个盒子只需要往左边移动到相应位置，那么需要移动多少？</strong></p><img width="756" height="317" src="'+o+`" class="jop-noMdConv"><p>通过这个图我们可以看到只需要移动<strong>middle的宽度+右边留出来的100px</strong>。即👇</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>position: relative;
margin-left: -100%;
right: 100px;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>通过这三行代码，分两步，<strong>向左偏移100%</strong>，并且<strong>再偏移一个100px</strong>,我们就将左边这个盒子挪到了middle左边了。 <img width="756" height="319" src="`+c+`" class="jop-noMdConv"></p><p>接下来就是右边这栏，同理，我们只需要挪动盒子的宽度100px即可。</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>margin-right: -100px;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div></div></div><img width="756" height="238" src="`+v+'" class="jop-noMdConv"><p><strong>至此，我们可以说已经基本上完成了圣杯布局，我们可以通过拉伸或缩小窗口验证是否为我们想要的效果。</strong></p><p><strong>优化：</strong> <img width="756" height="356" src="'+p+`" class="jop-noMdConv"></p><p>我们可以看到中间这栏是实现了自适应，但是还有一点小缺陷，就是当窗口过小的时候布局会受到影响。 只需要<strong>在body上设置最小宽度即可</strong>。</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>body {
        /* 设置最小宽度，防止挤压使中间内容消失 */
        min-width: 600px;
    }
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>这样一个简单的圣杯布局就完成啦。</p><p>总结一下，<strong>圣杯布局就是将基本布局之后使用向左浮动，middle栏留出两边位置，然后使用相对定位将左右两栏通过<code>margin-left</code>定位到相应位置。（是不是很简单！)</strong></p><h2 id="三、双飞翼布局的实现过程" tabindex="-1"><a class="header-anchor" href="#三、双飞翼布局的实现过程" aria-hidden="true">#</a> 三、双飞翼布局的实现过程</h2><p>我们再来看看双飞翼布局的实现，首先也是写一下基本的html：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>&lt;div class=&quot;header&quot;&gt;header&lt;/div&gt;
    &lt;div class=&quot;main middle&quot;&gt;middle&lt;/div&gt;
    &lt;div class=&quot;left&quot;&gt;left&lt;/div&gt;
    &lt;div class=&quot;right&quot;&gt;right&lt;/div&gt;
    &lt;div class=&quot;footer&quot;&gt;footer&lt;/div&gt;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>样式上也是需要向左浮动，前面的基本一致，现在的效果如下👇 <img width="756" height="306" src="`+b+`" class="jop-noMdConv"></p><p>然后不一样的是， 我们不使用相对定位，而是直接通过<code>margin-left</code>，将left栏移动到middle栏上，right栏也一样。</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>.left {
        margin-left: -100%;
    }
    .right {
        margin-left: -100px;
    }
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>效果已经是三栏布局了，但是注意看此时的middle的内容被左右两栏遮住了（即<strong>看不到middle文本了</strong>）</p><img width="756" height="238" src="`+u+`" class="jop-noMdConv"><p>因为左右两栏覆盖了middle栏的内容。此时应该可以想到，只要将middle栏设置padding即可将内容挤到中间可视区域了。</p><p><strong>这里有个问题就是</strong>，如果直接在middle栏里面加padding,会导致整个布局乱套。</p><p>所以我们需要在middle栏里面再套一层div，那么现在的html就会变成这样：</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>&lt;div class=&quot;header&quot;&gt;header&lt;/div&gt;
    &lt;div class=&quot;main middle&quot;&gt;
        &lt;div id=&quot;main-wrapper&quot;&gt;middle&lt;/div&gt;
    &lt;/div&gt;
    &lt;div class=&quot;left&quot;&gt;left&lt;/div&gt;
    &lt;div class=&quot;right&quot;&gt;right&lt;/div&gt;
    &lt;div class=&quot;footer&quot;&gt;footer&lt;/div&gt;
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>我们在里面这层div上加padding,即👇</p><div class="language-text line-numbers-mode" data-ext="text"><pre class="language-text"><code>.main #main-wrapper {
       padding-left: 100px;
       padding-right: 100px;
    }
</code></pre><div class="line-numbers" aria-hidden="true"><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div><div class="line-number"></div></div></div><p>至此，我们就实现了双飞翼布局： <img width="756" height="229" src="`+E+'" class="jop-noMdConv"></p><img width="756" height="400" src="'+m+'" class="jop-noMdConv"><h2 id="四、总结" tabindex="-1"><a class="header-anchor" href="#四、总结" aria-hidden="true">#</a> 四、总结</h2><p>最后总结一下，二者的异同。</p><h3 id="_1、相同之处" tabindex="-1"><a class="header-anchor" href="#_1、相同之处" aria-hidden="true">#</a> 1、相同之处</h3><p>（1）布局类似，都是实现特定需求的三列布局。</p><p>（2）都使用了<code>float</code>浮动向左脱离文档流,让左中右三列浮动，通过父外边距形成三列布局。</p><h3 id="_2、不同之处" tabindex="-1"><a class="header-anchor" href="#_2、不同之处" aria-hidden="true">#</a> 2、不同之处</h3><p><strong>（1）实现方法的不同：</strong></p><p><strong>圣杯布局</strong>是通过<code>float</code>搭建布局+<code>margin</code>使三列布局到一行上+<code>relative</code>相对定位调整位置。</p><p><strong>双飞翼布局</strong>是通过<code>float</code>+<code>margin</code>，<strong>没有使用相对定位</strong>。</p><p><strong>（2）怎么处理两列的位置：</strong></p><p><strong>圣杯布局</strong>是给外部容器加<code>padding</code>，通过相对定位把两边定位出来。</p><p><strong>双飞翼布局</strong>是靠在中间这层外面套一层<code>div</code>加<code>padding</code>将内容挤出来中间。</p>',73),f=[h];function I(Q,B){return i(),d("div",null,f)}const J=e(C,[["render",I],["__file","CSSzhishengbeibujuyushuangfeiyibuju.html.vue"]]);export{J as default};
